pragma solidity ^0.8.0;

contract SmallStruct {
    address public myAddr = 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2;
    uint public amount;


  struct LovePay {
      address senderAddr;
        uint amount;
    }

    LovePay[] public payments;

    function demo() public {
        LovePay memory newLove = LovePay(myAddr, 243);
        payments.push(newLove);

        amount = newLove.amount;
    }
}

